/** @format */
import Main from './Main';

function Home() {
	return (
		<>
			<div className='my-container'>
				{/* Home */}
				<Main />
				<div className='my-16 sm:my-32 h-px bg-slate-300	'></div>
				프로젝트와 팀 페이지가 있다고 소개해야함
				<section>
					<h2 className='small-title'> Project Page</h2>
				</section>
				<section>
					<h2 className='small-title'>Team Page</h2>
				</section>
			</div>
		</>
	);
}

export default Home;
